function GetHTTP(url,callback_function)
  {
    // random value (workaround to avoid caching)
    var r = ""; //"?"+btoa(Math.round(Math.random(1)*6*6*6)+"").replace(new RegExp("=","g"),"");
    const xhttp = new XMLHttpRequest();
    xhttp.onload = callback_function;
    xhttp.open("GET", url+r);
    xhttp.send();
  }

  function keycap_click(t)
  {
    alert(t.innerHTML);
  }

  function keycap_over(t)
  {
    //alert(t.innerHTML);
  }

var oPROCESS = new function()
{
    this.b64DecodeUnicode = function(str)
    {
        // Going backwards: from bytestream, to percent-encoding, to original string.
        return decodeURIComponent(atob(str).split('').map(function(c) {
            return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
        }).join(''));
    }

    this.process_layout = function(resT,resU)
    {
        //console.log("process_layout = "+resT)
        //console.log("process_layout = "+resU)

        var rep = '/fonts/'
        var r = new RegExp(rep,"g");
        var kbcss = resT.replace(r,'../res/fonts/');
        var txt = this.b64DecodeUnicode(b64);   //console.log(txt);

        var pos1 = txt.indexOf("customStyles");
        var styl = txt.substring(pos1,txt.length);
        styl = styl.substring(styl.indexOf(">")+1,styl.length);
        var pos2 = styl.indexOf("</style>");
        styl = styl.substring(0,pos2);

        // INSERT CSS snippets
        document.getElementById("kbcss").innerHTML = "<style>"+styl+" "+kbcss+"</style>";


        var pos1 = txt.indexOf('<div id="keyboard"');
        var pos2 = txt.indexOf('<div style="clear:both"></div>');
        var snippet = txt.substring(pos1,pos2);
        var snippet = snippet.replace(/( ng-[a-zA-Z0-9:;\.\s\(\)\-\,]*)="([^"]*)"/g," ");
        var snippet = snippet.replace(/(class="  keycap")/g,"&1 onmouseover=keycap_over(this) onclick=keycap_click(this)");

        
        

        console.log("snippet="+(snippet.length/1024)+"KB");

        // INSERT HTML snippet
        document.getElementById("kbsnippet").innerHTML = snippet;
    }
}()

var url = "https://raw.githubusercontent.com/RetroAppleJS/RetroAppleJS.github.io/main/res/kb.css"
